import React from 'react'
import Node from './Component/node'

export default class PathFinder extends React.Component {

    componentDidMount() {
        const nodes = [] 
        for(let row = 0; row <= 15; row++) {
            const curRow = []
            for(let col =0; col <=40; col++) {
                curRow.push([])
            }
            nodes.push(row)
        }
        this.setState({nodes})
    }

    render() {
        console.log(this.state)
        const {nodes} = this.state.grid
        console.log(nodes)
        return (
            <div>
                {this.state !== undefined || null ? nodes.map(node => { return <Node nodeInfo={node}/>}): console.log('no state')}
            </div>
        )
    }
}
